import React from 'react'

import './loginPage.css'

export default function LoginPage() {
    return(
        <div id="container">
            <h2 style={{color:white}}>Sign In</h2>
            <div id="inp-container">
                <input className="inp-box" type="text" placeholder='Username'></input>
                <input className="inp-box" type="password" placeholder='Password'></input>
            </div>
        </div>
    )
}
